    <h1>Zinger</h1>
    <p>A Zinger Burger is KFC's original fried chicken recipe with a spicy twist. Hot fried chicken is sandwiched between a sesame bun together with lettuce and a creamy dressing for a classic chicken burger with a hint of spice.</p>
